var trTR={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"İzin vermek","Allow in your wallet":"Cüzdanınızda izin verin","Allow {symbol} first":["Önce ",["symbol"]," izin ver"],"Allowance pending":"ödenek beklemede","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Bu takas yürütülmeye çalışılırken bir hata oluştu. Kayma toleransınızı artırmanız gerekebilir. Bu işe yaramazsa, işlem yaptığınız token ile uyumsuzluk olabilir. Not: Transfer ve rebase jetonlarındaki ücret, Uniswap V3 ile uyumlu değildir.","Approval pending":"Onay Bekliyor","Approve":"Onayla","Approve Permit2":"Approve Permit2","Approve in your wallet":"Cüzdanınızda onaylayın","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Önce ",["symbol"]," onayla"],"Auto":"Otomatik","Auto Router":"Otomatik Yönlendirici","Auto Router API":"Auto Router API","Balance:":"Bakiye:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Kapat","Confirm in your wallet":"Cüzdanınızda onaylayın","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Cüzdan bağlayın","Connecting…":"Bağlanıyor…","Continue":"Continue","Convert {0} to {1}":[["0"]," ",["1"],"dönüştür"],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Cüzdan bağlantısını kes","Dismiss":"Reddet","Enter an amount":"Bir tutar girin","Error fetching trade":"Takas alınırken hata oluştu","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"En iyi fiyat getiriliyor…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Yüksek kayma, fiyat hareketi riskini artırır","I don't have a wallet":"cüzdanım yok","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Yetersiz ",["0"]," bakiye"],"Invalid recipient":"Geçersiz alıcı","Max":"Maksimum","Max slippage":"Maksimum kayma","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Eksik bağımlılıklar","Network fee":"Ağ ücreti","No results found.":"Sonuç bulunamadı.","No tokens are available on this network. Please switch to another network.":"Bu ağda kullanılabilir jeton yok. Lütfen başka bir ağa geçin.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Lütfen geçerli bir kayma yüzdesi girin","Powered by the Uniswap protocol":"Uniswap protokolü tarafından desteklenmektedir","Price impact":"Fiyat etkisi","Price updated":"Fiyat güncellendi","Reload":"Reload","Reload the page":"Sayfayı yenile","Request rejected":"Request rejected","Review swap":"Değişimi gözden geçir","Search by token name or address":"Belirteç adına veya adresine göre arama yapın","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Bir şeyler yanlış gitti","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Başarı","Swap":"Swap","Swap failed: {0}":["Değiştirilemedi: ",["0"]],"Switch network":"Ağı değiştir","Switch network in your wallet":"Cüzdanınızdaki ağı değiştirin","Switching network":"Ağ değiştirme","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Uniswap değişmez değeri x*y=k, swap ile sağlanmadı. Bu genellikle, swap ettiğiniz jetonlardan birinin aktarım sırasında özel davranış içerdiği anlamına gelir.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Giriş jetonu aktarılamaz. Giriş jetonuyla ilgili bir sorun olabilir.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Çıkış jetonu aktarılamaz. Çıkış jetonuyla ilgili bir sorun olabilir.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Çıkış jetonu aktarılamaz. Çıkış belirteciyle ilgili bir sorun olabilir. Not: Transfer ve rebase jetonlarındaki ücret, Uniswap V3 ile uyumlu değildir.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Bu işlem, fiyat hareketi nedeniyle başarılı olamayacak. Kayma toleransınızı artırmayı deneyin. Not: Transfer ve rebase jetonlarındaki ücret, Uniswap V3 ile uyumlu değildir.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Bu işlem, ya fiyat hareketinden dolayı ya da transfer ücretinden dolayı başarılı olmayacak. Kayma toleransınızı artırmayı deneyin.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"İşlem son tarihi","Transaction rejected":"İşlem reddedildi","Transaction submitted":"İşlem gönderildi","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Kayma toleransınızı artırmayı deneyin.<0/>NOT: Transfer ve rebase belirteçleri üzerindeki ücret, Uniswap V3 ile uyumlu değildir.","Unexpected error. Could not estimate gas for the swap.":"Beklenmeyen hata. Takas için gaz tahmin edilemedi.","Unexpected issue with estimating the gas. Please try again.":"Gaz tahmininde beklenmeyen bir sorun. Lütfen tekrar deneyin.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Etherscan üzerinde görüntüle","Wallet disconnected":"Wallet disconnected","Warning":"Uyarı","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"İşleminiz bu süreden daha uzun süredir beklemedeyse geri alınacaktır.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Fiyatın istenmeyen şekilde bu yüzdeden daha fazla değişmesi durumunda işleminiz geri döner.","minutes":"dakika","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," ücret"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

